#
# TABLE STRUCTURE FOR: concurrency
#

DROP TABLE IF EXISTS concurrency;

CREATE TABLE `concurrency` (
  `type` char(3) NOT NULL,
  `username` varchar(20) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: confirmcode
#

DROP TABLE IF EXISTS confirmcode;

CREATE TABLE `confirmcode` (
  `code` varchar(150) NOT NULL,
  PRIMARY KEY (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: customer
#

DROP TABLE IF EXISTS customer;

CREATE TABLE `customer` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `custID` varchar(10) NOT NULL,
  `custName` varchar(50) NOT NULL,
  `address` varchar(150) NOT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`custID`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: delivery
#

DROP TABLE IF EXISTS delivery;

CREATE TABLE `delivery` (
  `id` int(2) NOT NULL AUTO_INCREMENT,
  `delName` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: discounts
#

DROP TABLE IF EXISTS discounts;

CREATE TABLE `discounts` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `transNum` varchar(10) NOT NULL,
  `inclusion` varchar(20) DEFAULT NULL,
  `vat` int(5) DEFAULT NULL,
  `rate` int(5) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1166 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: orderline
#

DROP TABLE IF EXISTS orderline;

CREATE TABLE `orderline` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `transNum` int(10) DEFAULT NULL,
  `type` char(15) DEFAULT NULL,
  `num` varchar(10) NOT NULL,
  `itemNo` int(10) NOT NULL,
  `qty` int(4) NOT NULL,
  `unit` char(10) NOT NULL,
  `descript` varchar(10000) NOT NULL,
  `sPrice` decimal(10,2) NOT NULL,
  `unitPrice` decimal(10,2) NOT NULL,
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3452 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: po
#

DROP TABLE IF EXISTS po;

CREATE TABLE `po` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `transNum` varchar(10) NOT NULL,
  `year` int(4) NOT NULL,
  `date` date NOT NULL,
  `refNo` varchar(10) NOT NULL,
  `supplierID` varchar(10) NOT NULL,
  `delivery` int(5) NOT NULL,
  `terms` int(5) NOT NULL,
  `attention` char(60) NOT NULL,
  `transDescript` varchar(100) NOT NULL,
  `totalAmount` decimal(10,2) NOT NULL,
  `prepared` varchar(40) NOT NULL,
  `qTotal` decimal(11,2) NOT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`transNum`),
  KEY `id` (`id`),
  KEY `supplierID` (`supplierID`),
  KEY `delivery` (`delivery`),
  KEY `terms` (`terms`),
  CONSTRAINT `po_ibfk_1` FOREIGN KEY (`supplierID`) REFERENCES `supplier` (`sID`),
  CONSTRAINT `po_ibfk_2` FOREIGN KEY (`delivery`) REFERENCES `delivery` (`id`),
  CONSTRAINT `po_ibfk_3` FOREIGN KEY (`terms`) REFERENCES `terms` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=669 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: preparer
#

DROP TABLE IF EXISTS preparer;

CREATE TABLE `preparer` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `fname` char(30) NOT NULL,
  `lname` char(30) NOT NULL,
  `username` varchar(30) NOT NULL,
  `password` varchar(150) NOT NULL,
  PRIMARY KEY (`username`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: quotation
#

DROP TABLE IF EXISTS quotation;

CREATE TABLE `quotation` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `transNum` varchar(10) NOT NULL,
  `year` int(4) NOT NULL,
  `date` date NOT NULL,
  `custID` varchar(10) NOT NULL,
  `subject` varchar(30) NOT NULL,
  `delivery` int(5) NOT NULL,
  `validity` int(5) NOT NULL,
  `terms` int(5) NOT NULL,
  `attention` varchar(60) NOT NULL,
  `transDescript` varchar(100) NOT NULL,
  `totalAmount` decimal(10,2) NOT NULL,
  `prepared` varchar(40) NOT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`transNum`),
  KEY `custID` (`custID`),
  KEY `delivery` (`delivery`),
  KEY `validity` (`validity`),
  KEY `terms` (`terms`),
  KEY `id` (`id`),
  CONSTRAINT `quotation_ibfk_1` FOREIGN KEY (`custID`) REFERENCES `customer` (`custID`),
  CONSTRAINT `quotation_ibfk_2` FOREIGN KEY (`delivery`) REFERENCES `delivery` (`id`),
  CONSTRAINT `quotation_ibfk_3` FOREIGN KEY (`validity`) REFERENCES `validity` (`id`),
  CONSTRAINT `quotation_ibfk_4` FOREIGN KEY (`terms`) REFERENCES `terms` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1159 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: supplier
#

DROP TABLE IF EXISTS supplier;

CREATE TABLE `supplier` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `sID` varchar(10) NOT NULL,
  `name` varchar(50) NOT NULL,
  `address` varchar(150) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`sID`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: terms
#

DROP TABLE IF EXISTS terms;

CREATE TABLE `terms` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `termName` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: validity
#

DROP TABLE IF EXISTS validity;

CREATE TABLE `validity` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `valName` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



