INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (551, 92, 'quotation', '012-2010', 1, 1, 'lot', 'Repair of SRI motherboard, \r\nincludes spare parts.\r\nVoltage and resistance testing. \r\nReplacement of transistor T25, \r\nburned resistor, IC TCHL 1425 and \r\nchip resistor. \r\nReplacement of switching IC. \r\nVoltage calibration. \r\nElectronic board cleaning. \r\nAll parts imported from Singapore. \r\nTesting and commissioning. \r\n\r\n\r\nNote: Warranty is 1 milling season', '55000.00', '78600.00');
