INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (553, 354, 'quotation', '045-2010', 1, 1, 'Pc', 'Simulator/calibrator of common \r\nthermocouples and RTD sensors:\r\nOutputs a signal equivalent to \r\nsignals of ten types of \r\nthermocouple K, E, J, T, N, R, U, L, \r\nB and S as well as Pt100 \r\nresistance temperature detector. \r\n(The former Pt100 standard, \r\nJPt100, is also selectable by an \r\ninternal dip switch.) Suitable for a \r\nbroad range of applications such \r\nas maintenance of industrial \r\nprocess instruments and various \r\nthermometers. \r\nMulti-range thermometer:\r\nCan be used as a multi-range \r\nthermometer. Three-wire RTD \r\nconnection for an RTD is possible. \r\nBuilt-in sensor for reference \r\njunction compensation:\r\nReference junction compensation \r\nwhen generating a thermocouple \r\nsignal can be performed by the \r\nbuilt-in temperature sensor. For \r\nmore precise compensation, use \r\nthe external RJC sensor (Model \r\nB9108WA). \r\nC/F Selection Key:\r\nSelect \"C\"or \"F\" unit. \r\nTerminal adapter:\r\nProvides screw terminals for \r\nconnecting a temperature sensor \r\nsuch as a thermocouple and RTD \r\nwhen measuring temperature. \r\nWhen sourcing an RTD signal, a \r\nthree-wire RTD signal can be \r\noutput using the lead cables that \r\ncome with the CA12 by short-\r\ncircuiting the Lo-Lo terminals using \r\nthe short-circuit bar that also \r\ncomes with the CA12.', '46681.82', '62500.00');
INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (554, 204, 'po', '028-2010', 1, 1, 'pc', 'Calibrator, 4-20 mA digital loop <br>\noutputs and mA reading, simulates <br>\nand calibrates 2 wire transmitters, <br>\nreading/fixed step in mA OT% span<br>\nModel: CA11E-2, Yokogawa', '0.00', '45648.00');
INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (555, 361, 'quotation', '046-2010', 1, 1, 'Pc', 'Source and Measuring of Voltage <br>\nand Current: <br>\nGeneral and measures voltages up <br>\nto 30V DC and current up to 24 <br>\nmA DC <br>\nImproved display resolution for <br>\ncurrent<br>\nThe generation /measurement <br>\nresolution has inproved to <br>\n0.001mA <br>\n24VDC(20mA) Loop check function<br>\n<br>\n4-20 mA and 1-5 VDC Step-<br>\nup/down Function: <br>\nThe output level can be changed <br>\nbetween 1&#8596;2&#8596;3&#8596;4&#8596;5V signals <br>\nfor the 1 to 5V DC output, for <br>\nefficient calibration work. <br>\n20 mA SINK Function: <br>\nAbsorb the voltage supplied from <br>\nan external power supply to its H <br>\nterminal and simulates a two-wire <br>\ntransmitter, idea for loop checks. <br>\nSweep Function:<br>\nIncrease and decrease the output <br>\nlevel to the preset level at a <br>\nconstant rate for the selected <br>\nsweep time (16 or 32 seconds). <br>\nThe sweep function and sweep <br>\ntime are set by the internal dip <br>\nswitch.', '46681.82', '57500.00');
