INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (2386, 111, 'quotation', '014-2013', 1, 1, 'set', 'ULTRASONIC TRANSIT TIME <br>\nFLOWMETER<br>\nPortable / Handheld  version<br>\nType TTFM100B-HH-A-NG-SP<br>\n<br>\nTHE HAND HELD FLOW METERS IS <br>\nSUPPLIED WITH: <br>\nNo. 1 couple of external CLAMP-<br>\nON transducers type TTS100-TS2-<br>\nNG for pipes from DN 15 to DN <br>\n100  <br>\nNo. 1 couple of external CLAMP-<br>\nON transducers type TTS100-TM1-<br>\nNG for pipes from DN 50 to DN <br>\n1000  <br>\nSensor Technology: Ultrasonic <br>\nTRANSIT-TIME <br>\nWorking frequency 921 KHz. <br>\nTransducers with 5 m + 5 m cable <br>\nextension <br>\nSensors Protection IP 67<br>\nMeasure bidirectional: + / - 32 m / <br>\nsec. <br>\nWorking temperature sensor std -<br>\n20 ... +80  C <br>\nCase with mounting clamps - <br>\nMeter - Silicone gel - Charger - <br>\nPlug Adaptor - RS232 cable.<br>\nInstruction Manual available in <br>\nItalian and English <br>\nCase with Mounting brackets- <br>\nMeter- Silicone gel- Battery <br>\ncharger- Instruction manual <br>\navailable i Italian and English', '184504.00', '263500.00');
INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (2387, 119, 'quotation', '015-2013', 1, 1, 'lot', 'Retrofitting of control of Thyssen <br>\nKrupp Centrifugal Machine No. 2.<br>\n<br>\n1.	Supply of PLC with <br>\nprogramming to replace existing <br>\nABB controller. The estimated <br>\nnumber of I/Os are:<br>\na.	DI = 26<br>\nb.	AI = 1<br>\nc.	DO = 30<br>\n2.	Supply of HMI with <br>\ngraphics in an IP54 enclosure with <br>\nstart, stop, 40 RPM and <br>\nemergency stop pushbuttons and <br>\nwarning light to replace existing <br>\nHMI. <br>\n3.	Supply of <br>\ncommunication cable of <br>\napproximately 30 m from PLC to <br>\nHMI.<br>\n4.	System testing and <br>\ncommissioning.<br>\n5.	Documentation <br>\nconsisting of wiring diagram, <br>\nprogramming, hardware and <br>\nsoftware manuals.<br>\n6.	PLC and HMI shall be <br>\nrugged and modular suitable for <br>\nreliable operation in an <br>\nenvironment where high <br>\ntemperature, dust, humidity and <br>\nmechanical vibrations are <br>\ncommon. PLC  should be computer <br>\nprogrammable in IEC 61131-3 <br>\nlanguages, with USB or Ethernet  <br>\ncomputer interface.<br>\n7.	CACI will provide <br>\nmanpower to assist in the wiring <br>\nand installation works.<br>\n8.	CACI will provide <br>\nmeals and on-site <br>\naccommodations for the vendors <br>\nengineers/technicians', '260000.00', '399500.00');
INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (2388, 127, 'quotation', '016-2013', 1, 1, 'lot', 'RETROFITTING OF ASEA BATCH \r\nCENTRIFUGAL #1 CONTROL\r\nDC Motor Specifications:\r\n	Asea motor LAB-\r\n380LC; 192 kW; 510 V; 408 A; \r\n1300 RPM; Exc: 220/110V; \r\n8.4/16.8 A\r\nDischarger Motor (with brake) \r\nSpecifications:\r\n	1.7/0.85 kW; 4/4.2 A; \r\n1150/560 rpm; 6 poles; 440 V\r\nTacho Generator Specifications:\r\n	BD 2510B; 100 v @ \r\n1000 Rev/min\r\nScope:\r\n1.	Supply of PLC with \r\nremote I/O module to replace \r\nexisting relays. \r\n2.	Supply of suitable DC \r\ndrive for a 192 kW 510V DC motor.\r\n3.	Supply of suitable \r\ncontrol for Discharger motor.\r\n4.	The PLC, DC drive and \r\nDischarger motor control will be in \r\na Rittal or equivalent  IP 54 \r\nenclosure complete with circuit \r\nbreakers, power supplies, \r\ntransformers, terminal blocks, \r\ninternal wirings and accessories.\r\n5.	Supply of HMI with \r\ngraphics in an IP54 enclosure with \r\nstart, stop, 40 RPM and \r\nemergency stop pushbuttons and \r\nalarms (visual and audible).\r\n6.	Optional: Supply of \r\nsuitable sensors with common \r\nbrand (i.e. effector) to replace \r\nexisting 110 V sensors. \r\n7.	Optional: Supply of \r\nvalve manifold (1/2 port) to \r\nreplace the existing solenoid valves\r\n(6 units).\r\n8.	Supply of \r\ncommunication cable of \r\napproximately 50 m from PLC to \r\nremote I/O and HMI.\r\n9.	System testing and \r\ncommissioning.\r\n10.	Documentation \r\nconsisting of wiring diagram, \r\nprogramming, hardware and \r\nsoftware manuals.\r\n11.	PLC, DC drive and HMI \r\nshall be suitable for a reliable \r\noperation in an environment \r\nwhere high temperature, dust, \r\nhumidity and mechanical \r\nvibrations are common. PLC \r\nshould be computer \r\nprogrammable in IEC 61131-3 \r\nlanguages, with USB or Ethernet \r\ncomputer interface.\r\n12.	CACI will provide \r\nmanpower to assist in the wiring \r\nand installation works.\r\n13.	CACI will provide \r\nmeals and on-site \r\naccommodations for the vendors \r\nengineers/technicians.', '1078921.00', '1842708.00');
