INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (2540, 587, 'quotation', '080-2013', 1, 1, 'Lot', 'Scope of Works:\r\n\r\nCabling Works\r\n\r\n1. Use 5.5mm2 THHN Cu Wire for \r\nPower loads such as outlets and \r\nGasoline dispenser.\r\n2.Use 3.5mm2 THHN Cu wire for \r\nlighting loads. Brand: Columbia of \r\nPhilflex.\r\n3. All cabling works are concealed \r\nusing PVC conduit. Must be \r\nembedded on concrete and buried \r\nunderground.\r\n\r\nConduit and Fittings:\r\n\r\n1. Use PVC conduit with explosion \r\nproof fittings.\r\n\r\nMain Panel:\r\n\r\n1. Existing main panel already \r\ninstalled. Relocate inside the MCC \r\nroom. Recessed mounted with \r\nbottom entry.\r\n\r\nInstrumentation:\r\n\r\n1. Supply and installation of \r\ncoriolis flowmeter w/2\" ANSI \r\nflange at 39 cu.m/hr Ex- Proof\r\n\r\nControl Valves:\r\n\r\n1. Supply and installation of two \r\n(2) units solenoid control valve, \r\n220 VAC, with 2 x 1.5\" dia. and 2\" \r\ndia. of flange. Ex-Proof.\r\n\r\nBatch Controller:\r\n\r\n1. Installation of Batch Controller \r\nand cabling. use 3.5mm x 2.5c \r\nSWA cable for coriolis flowmeter \r\nas I/O cable and for batch \r\ncontroller input AC supply. Use \r\n1.25mm2 x 2.5c SWA cable as I/O \r\ncable for solenoid control valve \r\nwith liquid tight conduit.\r\n\r\n2. Supply and install Explosion \r\nProof emergency push button \r\nswitch and cabling.\r\n\r\nPower Supply:\r\n\r\n1. Supply and install regulated DC \r\npower supply, 60w with 24 VDC \r\noutput for batch controller', '1.00', '1933000.00');
