INSERT INTO orderline (`id`, `transNum`, `type`, `num`, `itemNo`, `qty`, `unit`, `descript`, `sPrice`, `unitPrice`) VALUES (2889, 386, 'quotation', '049-2014', 1, 1, 'lot', 'RETROFITTING OF ASEA BATCH \r\nCENTRIFUGAL #1 CONTROL DC \r\nMotor Specifications: Asea motor \r\nLAB- 380LC; 192 kW; 510 V; 408 \r\nA; 1300 RPM; Exc: 220/110V; \r\n8.4/16.8 A Discharger Motor (with \r\nbrake) Specifications: 1.7/0.85 \r\nkW; 4/4.2 A; 1150/560 rpm; 6 \r\npoles; 440 V Tacho Generator \r\nSpecifications: BD 2510B; 100 v @ \r\n1000 Rev/min Scope: 1. Supply of \r\nPLC with remote I/O module to \r\nreplace existing relays. 2. Supply \r\nof suitable DC drive for a 192 kW \r\n510V DC motor. 3. Supply of \r\nsuitable control for Discharger \r\nmotor. 4. The PLC, DC drive and \r\nDischarger motor control will be in \r\na Rittal or equivalent IP 54 \r\nenclosure complete with circuit \r\nbreakers, power supplies, \r\ntransformers, terminal blocks, \r\ninternal wirings and accessories. \r\n5. Supply of HMI with graphics in \r\nan IP54 enclosure with start, stop, \r\n40 RPM and emergency stop \r\npushbuttons and alarms (visual \r\nand audible). 6. Optional: Supply \r\nof suitable sensors with common \r\nbrand (i.e. effector) to replace \r\nexisting 110 V sensors. 7. \r\nOptional: Supply of valve manifold \r\n(1/2 port) to replace the existing \r\nsolenoid valves (6 units). 8. \r\nSupply of communication cable of \r\napproximately 50 m from PLC to \r\nremote I/O and HMI. 9. System \r\ntesting and commissioning. 10. \r\nDocumentation consisting of wiring \r\ndiagram, programming, hardware \r\nand software manuals. 11. PLC, \r\nDC drive and HMI shall be suitable \r\nfor a reliable operation in an \r\nenvironment where high \r\ntemperature, dust, humidity and \r\nmechanical vibrations are \r\ncommon. PLC should be computer \r\nprogrammable in IEC 61131-3 \r\nlanguages, with USB or Ethernet \r\ncomputer interface. 12. CACI will \r\nprovide manpower to assist in the \r\nwiring and installation works. 13. \r\nCACI will provide meals and on-\r\nsite accommodations for the \r\nvendors engineers/technicians.', '900000.00', '2500000.00');
